const image = new Image();

image.src = 'data:image/jpeg;base64,';

function calculateAspectRatioFit(srcWidth, srcHeight, maxWidth, maxHeight) {
  var ratio = Math.min(maxWidth / srcWidth, maxHeight / srcHeight);

  return { width: srcWidth * ratio, height: srcHeight * ratio };
}

function getWidth() {
  return Math.max(
    document.body.scrollWidth,
    document.documentElement.scrollWidth,
    document.body.offsetWidth,
    document.documentElement.offsetWidth,
    document.documentElement.clientWidth
  );
}

function getHeight() {
  return Math.max(
    document.body.scrollHeight,
    document.documentElement.scrollHeight,
    document.body.offsetHeight,
    document.documentElement.offsetHeight,
    document.documentElement.clientHeight
  );
}

function imageDistortion() {
  const windowWidth = getWidth();
  const windowHeight = getHeight();

  console.log(windowWidth);
  console.log(windowHeight);

  const canvas = document.getElementById('canvas-particles');
  const ctx = canvas.getContext('2d');

  const imageSize = calculateAspectRatioFit(
    1920,
    1280,
    windowWidth,
    windowHeight
  );
  console.log(imageSize);

  canvas.width = imageSize.width;
  canvas.height = imageSize.height;
  canvas.style.width = `${imageSize.width}px`;
  canvas.style.height = `${imageSize.height}px`;

  ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particleArray = [];
  const numberOfParticles = 6000;

  let mappedImage = [];
  console.log('hello');
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const pixelColor = [red, green, blue];
      row.push(pixelColor);
    }
    mappedImage.push(row);
  }
 
 

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = Math.random() * canvas.height;
      this.speed = 0;
      this.velocity = Math.random() * 2;
      this.size = Math.random() * 8 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.color = '';
    }

    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);

      this.color = `rgb(${mappedImage[this.position1][this.position2][0]}, ${
        mappedImage[this.position1][this.position2][1]
      }, ${mappedImage[this.position1][this.position2][2]})`;
      const movement = 2.5 - this.speed + this.velocity + 1;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    draw() {
      ctx.beginPath();
      ctx.fillStyle = this.color;
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray.push(new Particle());
    }
  }

  init();

  function animate() {
    ctx.globalAlpha = 0.01;

    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0,0,20)';
    ctx.fillRect = (0, 0, canvas.width, canvas.height);

    ctx.globalAlpha = 0.2;
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray[i].update();
      ctx.globalAlpha = Math.random() * 1.5 + 1;
      particleArray[i].draw();
    }

    requestAnimationFrame(animate);
  }

  animate();
}

image.addEventListener('load', function () {
  imageDistortion();
});
